        <Col
          className="test"
          md={{ span: 4, offset: 4 }}
        >{`md={{ span: 4, offset: 4 }}`}</Col>
      </Row>
      <Row>
        <Col
          className="test"
          md={{ span: 3, offset: 3 }}
        >{`md={{ span: 3, offset: 3 }}`}</Col>
        <Col
          className="test"
          md={{ span: 3, offset: 3 }}
        >{`md={{ span: 3, offset: 3 }}`}</Col>
      </Row>
      <Row>
        <Col
          className="test"
          md={{ span: 6, offset: 3 }}
        >{`md={{ span: 6, offset: 3 }}`}</Col>
      </Row>
      <Row fluid>
        <Col className="test" xs={12} sm={6} md={4} lg={4}>
          sm=true
        </Col>
        <Col className="test" xs={12} sm={6} md={4} lg={4}>
          sm=true
        </Col>
        <Col className="test" xs={12} sm={6} md={4} lg={4}>
          sm=true
        </Col>
      </Row>
    </Container>
  );
}

export default App;
